import { makeStyles } from '@material-ui/core/styles'
import ArrowBackIcon from '@material-ui/icons/ArrowBack'

const useStyles = makeStyles(theme => ({
  root: {
    padding: '30px 50px',
  },
  back: {
    fontSize: 18,
  },
  arrowBackIcon: {
    verticalAlign:'middle',
    marginRight:12,
  },
  header: {
    fontSize: 30,
    paddingTop:20,
  },
  row: {
    height: 80,
    borderBottom: "1px solid #ddd",
    fontSize: 20,
    lineHeight:"80px"
  },
  label: {
    verticalAlign: 'middle',
  },
  chevronRightIcon : {
    float:'right',
    verticalAlign: 'middle',
    marginTop:24,
    fontSize:40,
  }
}))

const FilterMobile = props => {
const classes = useStyles()


  return (
    <div className={classes.root}>
      <div className={classes.back} onClick={props.toggleDrawer}>
        <ArrowBackIcon className={classes.arrowBackIcon} />
        <span>Back to Therapists</span>
      </div>
      <h2 className={classes.header}>Filters</h2>
      <div className={classes.row}>
        <div>
          <span className={classes.label}>Client Type</span>
        </div>
      </div>
      <div className={classes.row}>
        <div>
          <span className={classes.label}>Specialty</span>
        </div>
      </div>
      <div className={classes.row}>
        <span className={classes.label}>Insurance</span>
      </div>
    </div>
  )
}

export default FilterMobile
